import { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";


function App() {
  const [query] = useState('')

  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<Home term={query} />}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
